import React from 'react';

const Poze = () =>{

    let data =[
        {
            id:1,
            imgSrc:'/images/Povestea SF foto site/10.jpg',
        }
    ]

    return(
        <>
        
        <div className="galerie">
            {data.map((item,index)=>{
                return(
                    <div className="poza" key="1">
                        <img src={item.imgSrc}/>

                    </div>
                )
            })}

        </div>
        </>
    )
}
export default Poze;
